var $bm_rt;
var eff, n, pingpong, timeOff, st, end, dur, f, t1, t2, cyc, toff, cyc, t, t;
function findMarker(mark) {
    for (var i = 1; i <= thisComp.marker.numKeys; i++) {
        if (thisComp.marker.key(i).comment == mark) {
            return thisComp.marker.key(i).time;
        }
    }
}
eff = effect('CT Perfect Loop Position');
n = Math.round(eff('Number of Cycles'));
pingpong = eff('Ping Pong');
timeOff = eff('Time Offset in Frames');
st = thisLayer.inPoint;
end = thisLayer.outPoint;
dur = $bm_sub(end, st);
f = thisComp.frameDuration;
t1 = key(1).time;
t2 = key(numKeys).time;
cyc = $bm_div(dur, n);
toff = $bm_sum($bm_sub($bm_sum(time, $bm_mul(cyc, 50)), st), $bm_mul(timeOff, f));
if (pingpong == true) {
    cyc = $bm_mul(cyc, 2);
    t = $bm_sub($bm_sum(t1, linear($bm_mod(toff, cyc), 0, $bm_div(cyc, 2), t1, t2)), linear($bm_mod(toff, cyc), $bm_div(cyc, 2), cyc, t1, t2));
} else {
    t = linear($bm_mod(toff, cyc), 0, cyc, t1, t2);
}
$bm_rt = valueAtTime(t);

